import React from 'react';
import { StyleSheet, View, Text, Image, Button } from 'react-native';


const GetStarted = () => {
  return (
    <View style={styles.container}>
      <Image source={require('../../assets/getStarted-house.png')} style={styles.icon} />
      <Text style={styles.header}>Header Text</Text>
      <Text style={styles.description}>Description text goes here...</Text>
      <View style={styles.bubbleContainer}>
        <View style={styles.bubble} />
        <View style={styles.bubble} />
        <View style={styles.bubble} />
        <View style={styles.bubble} />
      </View>
      <Button title="Get Started" onPress={() => alert('Get Started Pressed')} />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#fff',
  },
  icon: {
    width: 100,
    height: 100,
  },
  header: {
    fontSize: 24,
    fontWeight: 'bold',
    margin: 20,
  },
  description: {
    fontSize: 16,
    margin: 20,
    textAlign: 'center',
  },
  bubbleContainer: {
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    margin: 20,
  },
  bubble: {
    width: 10,
    height: 10,
    margin: 5,
    borderRadius: 5,
    backgroundColor: '#000',
  },
});

export default GetStarted;
